package com.nhnacademy.springmvc.controller;

import com.nhnacademy.springmvc.domain.Answer;
import com.nhnacademy.springmvc.domain.Post;
import com.nhnacademy.springmvc.domain.PostType;
import com.nhnacademy.springmvc.exception.InvalidPostAccessException;
import com.nhnacademy.springmvc.exception.ValidationFailedException;
import com.nhnacademy.springmvc.repository.AnswerRepository;
import com.nhnacademy.springmvc.repository.PostRepository;
import lombok.extern.slf4j.Slf4j;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;
import org.springframework.test.web.servlet.MockMvc;
import org.springframework.test.web.servlet.MvcResult;
import org.springframework.test.web.servlet.setup.MockMvcBuilders;
import org.springframework.web.servlet.ModelAndView;
import org.springframework.web.util.NestedServletException;

import java.util.ArrayList;
import java.util.List;
import java.util.Optional;
import java.util.stream.Stream;

import static org.assertj.core.api.Assertions.assertThat;
import static org.assertj.core.api.Assertions.catchThrowable;
import static org.mockito.ArgumentMatchers.anyLong;
import static org.mockito.ArgumentMatchers.anyString;
import static org.mockito.Mockito.*;
import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.get;
import static org.springframework.test.web.servlet.request.MockMvcRequestBuilders.post;
import static org.springframework.test.web.servlet.result.MockMvcResultMatchers.*;

@Slf4j
class AdminControllerTest {
    MockMvc mockMvc;

    PostRepository postRepository;
    AnswerRepository answerRepository;

    @BeforeEach
    void setUp() {
        postRepository = mock(PostRepository.class);
        answerRepository = mock(AnswerRepository.class);

        mockMvc = MockMvcBuilders.standaloneSetup(new AdminController(postRepository, answerRepository)).build();
    }

    @Test
    @DisplayName("문의 목록 보이기 성공")
    void showInquiryLists_success() throws Exception {
        List<Post> posts = new ArrayList<>();

        when(postRepository.getPostsByAnswer()).thenReturn(posts);

        MvcResult result = mockMvc.perform(get("/admin/list"))
                .andExpect(status().isOk())
                .andExpect(view().name("admin/inquiryList"))
                .andReturn();

        assertThat(result.getModelAndView().getModel().get("posts")).isEqualTo(posts);
    }

    @Test
    @DisplayName("특정 문의 목록 보이기 성공")
    void showInquiryListsWithType_success() throws Exception {
        PostType postType = PostType.COMPLAIN;
        List<Post> posts = getPosts(postType);

        when(postRepository.getPostsByAnswer(postType)).thenReturn(posts);

        MvcResult result = mockMvc.perform(get("/admin/list")
                        .param("type", postType.toString()))
                .andExpect(status().isOk())
                .andExpect(view().name("admin/inquiryList"))
                .andReturn();

        Optional<List<Post>> resultPost = Optional.ofNullable(result.getModelAndView())
                .map(ModelAndView::getModel)
                .map(m -> m.get("posts"))
                .map(List.class::cast);

        assertThat(result.getModelAndView().getModel().get("type")).isEqualTo(postType.toString());
        assertThat(resultPost).isPresent();
        assertThat(resultPost.get()).isEqualTo(posts);
        assertThat(resultPost.get()
                .stream()
                .map(Post.class::cast)
                .map(x -> x.getPostType())
                .allMatch(x -> x == PostType.COMPLAIN))
                .isTrue();

    }

    @Test
    @DisplayName("문의 게시글 답변폼 보이기 실패 - 없는 문의 게시물 번호")
    void showInquiryAnswerForm_fail_invalidPostId_thenThrowInvalidPostAccessException() {
        long postId = 100;

        when(postRepository.exists(postId)).thenReturn(false);

        Throwable th = catchThrowable(() ->
                mockMvc.perform(get("/admin/answer/{postId}", postId))
        );

        assertThat(th).isInstanceOf(NestedServletException.class)
                .hasCauseInstanceOf(InvalidPostAccessException.class);
    }

    @Test
    @DisplayName("문의 게시글 답변폼 보이기 성공")
    void showInquiryAnswerForm_success() throws Exception {
        long postId = 1;
        Post post = getPosts(PostType.OTHERS).get((int) postId);

        when(postRepository.exists(postId)).thenReturn(true);
        when(postRepository.getPost(postId)).thenReturn(post);


        MvcResult result = mockMvc.perform(get("/admin/answer/{postId}", postId))
                .andExpect(status().isOk())
                .andExpect(view().name("admin/answerForm"))
                .andReturn();

        assertThat(result.getModelAndView().getModel().get("post")).isEqualTo(post);
    }

    //40000만자 테스트 불가능 : 너무 긴 문자열...
    @ParameterizedTest(name = "{1}")
    @MethodSource(value = "validationTestValue")
    @DisplayName("문의 답변 등록 실패 - 입력폼 형식 오류")
    void registerInquiryAnswer_failByValidation_thenThrowValidationFailedException(String content, String displayName) throws Exception {
        Throwable th = catchThrowable(() ->
                mockMvc.perform(post("/admin/answer/{postId}", 1)
                        .param("content", content))
        );

        assertThat(th).isInstanceOf(NestedServletException.class)
                .hasCauseInstanceOf(ValidationFailedException.class);
    }

    @Test
    @DisplayName("문의 답변 등록 실패 - 없는 문의 게시글 번호")
    void registerInquiryAnswer_failByInvalidPostId_thenThrowInvalidPostAccessException() throws Exception {
        Throwable th = catchThrowable(() ->
                mockMvc.perform(post("/admin/answer/{postId}", 1)
                        .param("content", "something"))
        );

        assertThat(th).isInstanceOf(NestedServletException.class)
                .hasCauseInstanceOf(InvalidPostAccessException.class);
    }

    @Test
    @DisplayName("문의 답변 등록 성공")
    void registerInquiryAnswer_success() throws Exception {
        long postId = 1;
        Post post = getPosts(PostType.OTHERS).get((int) postId);
        Answer answer = new Answer(1, "amdin@1", "2022-11-29 23:22:34", "answer");

        when(postRepository.exists(postId)).thenReturn(true);
        when(postRepository.getPost(postId)).thenReturn(post);
        when(answerRepository.register(anyString(), anyString(), anyString())).thenReturn(answer);

        mockMvc.perform(post("/admin/answer/{postId}", postId)
                        .param("content", "something")
                        .sessionAttr("sessionId", "admin@1"))
                .andExpect(status().is3xxRedirection())
                .andExpect(redirectedUrl("/admin/list"));

        verify(postRepository).exists(anyLong());
        verify(postRepository).getPost(anyLong());
        verify(answerRepository).register(anyString(), anyString(), anyString());
    }

    private List<Post> getPosts(PostType postType) {
        List<Post> posts = new ArrayList<>();

        for (int i = 0; i < 5; i++) {
            posts.add(new Post(i, "title", postType, "user@1", "2022-11-19 14:32:33", null, ""));
        }

        return posts;
    }
    private static Stream<Arguments> validationTestValue() { // argument source method
        return Stream.of(
                Arguments.of("", "내용 : 1자 미만인 경우"),
                Arguments.of("", "내용 : 40000자를 초과한 경우")
        );
    }
}